import logo from './logo.svg';
// import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Redirect,
} from "react-router-dom";

import Main from "./Main";
import SignUp from "./Screen/Seller/SignUp";

function App() {
  return (
    <div >
      <Router>
          <Routes>
            <Route exact path='/' element={<Main/>} />
            <Route path='/SignUp' element={<SignUp/>} />
            {/* <Route exact path="/" component={Main} />
            <Route path="/SignUp" component={SignUp} /> */}
          </Routes>

      </Router>
      <script crossorigin src="https://demo-designprojects.com/html/sigma-bank/js/bootstrap.min.js"></script>
      <script crossorigin src="https://demo-designprojects.com/html/sigma-bank/js/particles.js"></script>
      <script crossorigin src="https://demo-designprojects.com/html/sigma-bank/js/particles.min.js"></script>
      <script crossorigin src="https://demo-designprojects.com/html/sigma-bank/js/slick.js"></script>
      <script crossorigin src="https://demo-designprojects.com/html/sigma-bank/js/app.js"></script>
    </div>
  );
}

export default App;
